import { Route, Switch } from "react-router";

import { MobileNumber } from "../components/Login/mobilenumber";

export const Routing = () => {
    

    return (
        <div>
            <Switch>
                
                <Route path="/login" exact> <MobileNumber/></Route>
          </Switch>
        </div>
    )
}
